INSERT INTO `param_perfil_inves` (`id_perfil_inv`, `id_investigacion`, `id_rol_inv`, `perfil`, `objeto`, `estado`) VALUES
(1, 1, 4, 'Terminación y aprobación de estudios de educación universitaria en: economía, economía industrial, administración de empresas, administración financiera, administración de negocios, administración financiera y de negocios internacionales, contaduría, estadística, finanzas y negocios Internacionales o en ingeniería industrial, ingeniería civil, ingeniería electrónica  o ingeniería  de sistemas y 1 año de experiencia relacionada, y este en capacidad de realizarlas.\r\nOcho (8) semestres universitarios cursados y aprobados en: economía, economía industrial, administración de empresas, administración financiera, administración de negocios, administración financiera y de negocios internacionales, contaduría, estadística, finanzas y negocios Internacionales o en ingeniería industrial, ingeniería civil, ingeniería electrónica  o ingeniería  de sistemas y 18 meses de experiencia relacionada, y este en capacidad de realizarlas.\r\nTítulo de formación tecnológica en: economía, economía industrial, administración de empresas, administración financiera, administración de negocios, administración financiera y de negocios internacionales, contaduría, estadística, finanzas y negocios Internacionales o en ingeniería industrial, ingeniería civil, ingeniería electrónica  o ingeniería  de sistemas y 2 años de experiencia relacionada, y este en capacidad de realizarlas.\r\nTítulo de formación técnica en: economía, economía industrial, administración de empresas, administración financiera, administración de negocios, administración financiera y de negocios internacionales, contaduría, estadística, finanzas y negocios Internacionales o en ingeniería industrial, ingeniería civil, ingeniería electrónica  o ingeniería  de sistemas y 3 años de experiencia relacionada, y este en capacidad de realizarlas.\r\n', 'Prestación de servicios de apoyo a la gestión para coordinar las actividades de seguimiento y control de los procesos preoperativos y operativos como la notificación, recolección, validación, consistencia de información y control de calidad, hasta la transferencia de información a DANE Central, de la  Encuesta Anual de Comercio - EAC del año estadístico de  2015, de las fuentes que le sean asignadas, durante la ejecución del contrato.', 'AC'),
(2, 1, 6, 'Título de formación tecnológica en los núcleos básicos del conocimiento en: economía, contaduría pública; ingeniería industrial y afines y en las carreras de administración de empresas, administración industrial, administración empresarial, administración en finanzas y negocios internacionales, administración financiera, negocios y finanzas internacionales, banca y finanzas e ingeniería de sistemas y 6 meses de experiencia relacionada, y este en capacidad de realizarlas.\r\nTítulo de formación técnica profesional en los núcleos básicos del conocimiento en: economía, contaduría pública; ingeniería industrial y afines y en las carreras de administración de empresas, administración industrial, administración empresarial, administración en finanzas y negocios internacionales, administración financiera, negocios y finanzas internacionales, banca y finanzas e ingeniería de sistemas y 9 meses de experiencia relacionada, y este en capacidad de realizarlas. \r\nCuatro (4) semestres universitarios cursados y aprobados en los núcleos básicos del conocimiento en: economía, contaduría pública; ingeniería industrial y afines y en las carreras de administración de empresas, administración industrial, administración empresarial, administración en finanzas y negocios internacionales, administración financiera, negocios y finanzas internacionales, banca y finanzas e ingeniería de sistemas y 1 año de experiencia relacionada, y este en capacidad de realizarlas. \r\n', 'Prestaciones de servicios de apoyo a la gestión para adelantar los procesos preoperativo y operativos de la notificación, crítica, captura, análisis de consistencia de la información y asesoría a las fuentes en el diligenciamiento de la Encuesta Anual de Comercio del año estadístico 2015, de las fuentes que les sean asignadas durante la ejecución del contrato.', 'AC');
